%[text] ## Source control in MATLAB
%[text] MATLAB can work with GIT even if GIT is not installed in your system. **Most of GIT functionality is accessible from the MATLAB environment itself**
%[text] ### Are you familiar with **`git?`**
%[text] #### **`-> Yes!`**
%[text] You can run any git command from MATLAB like this!
!git help %[output:36ea3fc3]
%[text] or if you even want to lose the **`!`** you can create this function and add it to your path:
%[text] ```matlabCodeExample
%[text] function git(varargin)
%[text] cmd = sprintf("git %s", strjoin(varargin, ' '));
%[text] system(cmd);
%[text] end
%[text] ```
%%
%[text] ### -\> a little
%[text] If you are medium git user or you don't have git installed int your computer. You can use the MATLAB Integration for git to get easier access to some commands
repo = gitrepo %[output:43648562]
%[text] Other commands include
%[text] - **`commit`**
%[text] - **`push`**
%[text] - **`merge`**
%[text] - **`fetch`**
%[text] - **`pull`**
%[text] - **`...`** \
%[text] For more information visit [Git in MATLAB](https://uk.mathworks.com/help/releases/R2025a/matlab/matlab-git-source-control.html?s_tid=CRUX_lftnav)
%[text] **We would still recommend using** [**MATLAB Projects.**](https://uk.mathworks.com/help/releases/R2025a/matlab/projects.html)
%%
%[text] #### **`-> No!`**
%[text] Try using a [project](https://uk.mathworks.com/help/releases/R2025a/matlab/projects.html)!
%%
%[text] ### Cloning a repository
%[text] To get started, we are going to clone a repository with some instructions. There are several ways of doing this:
%[text] #### Via command line:
%[text] ```matlabCodeExample
%[text] !git clone https://github.com/ebenetce/AzureDevOpsDemo.git
%[text] ```
%[text] #### Via the MATLAB function
%[text] ```matlabCodeExample
%[text] repo = gitclone("https://github.com/ebenetce/AzureDevOpsDemo.git");
%[text] ```
%[text] #### Via the UI
%[text] ![](text:image:02d0)
%[text] This repository only contains a main file, if we are not very familiar with Git, it might be hard to work with it. It is best to work with Projects.
%%
%[text] ### Setting up a project
%[text] You can do it via the Desktop itself and just point it to the folder where you have the files:
%[text] ![](text:image:503f)
%[text] or directly from the command line:
prj = matlab.project.createProject('Folder',pwd, Name = 'MyNewModel') %[output:6df14f34]
%[text] What has this done:
%[text] 1. Added a **`MyNewModel.prj`**
%[text] 2. Added a "resources" folder with project metadata. You can ignore it but don't remove it.
%[text] 3. If you have a git repo, it added a **`.gitignore`** and **`.gitattributes`** files to help you manage your git repo
%[text] 4. All new files have been added to git. \
%[text] Let's commit and push those changes:
%[text] ```matlabCodeExample
%[text] repo = gitrepo()
%[text] commit(repo, Message = "Added project")
%[text] ```
%%
%[text] ### Open the project
%[text] After it has been crated, you always start here when you want to work in a project. You can also double click on the project file itself.
openProject('MyNewModel.prj');
%%
%[text] ### Add a function
%[text] The first thing we want to do, is to add a function to this project.
mkdir src
websave('src/PC_slope.m', "https://raw.githubusercontent.com/JohannesPfeifer/DSGE_mod/refs/heads/master/Smets_Wouters_2007/PC_slope.m") %[output:5d654650]
%[text] Try calling that function
%[text] ```matlabCodeExample
%[text] PC_Slope()
%[text] ```
%[text] It does not work. That is expected. In the past this was solved by either of these two approaches:
%[text] 1. Put all the files in the current folder.
%[text] 2. Have a set of commands of this type at the start (**`addpath, restoredefaultpath`**). \
%[text] We have a project now, so you can add the folder to the project path and the project will make that function available as long as it is open:
%[text]  ![](text:image:8b19)
%[text] Try calling the function now when the project is open and closed. You will see the difference:
%[text] **Bonus: The file has been added to git for you!**
%[text] Let's commit the changes!
%[text] ```matlabCodeExample
%[text] repo = gitrepo()
%[text] commit(repo, Message = "New function") % !git -am commit -am "New Function"
%[text] ```
%[text] ### 
%%
%[text] ### Add a Model
%[text] And add it to your project. This will sync our Git repo automatically:
%[text] ![](text:image:4324)
%[text] Do some modifications:
%[text] ```matlabCodeExample
%[text] estimation(optim=('MaxIter',200),datafile='data/usmodel_data',mode_file='data/usmodel_mode',mode_compute=0,first_obs=1, presample=4,lik_init=2,prefilter=0,mh_replic=0,mh_nblocks=2,mh_jscale=0.20,mh_drop=0.2, nograph, nodiagnostic, tex);
%[text] ```
%[text] Let's check the models runs:
dynare Smets_Wouters_2007_45.mod nolog
